import React from 'react';
import './App.css';
import WeatherApp from './Components/WeatherApp';
import { createTheme } from '@material-ui/core/styles';

const theme = createTheme({
  palette: {
    primary: "#eee",
  },
});

function App() {
  return (
    <div className="App">
     <WeatherApp />
    </div>
  );
}

export default App;
